class MLP(nn.Module):
    def __init__(self, input_dim, output_dim):
        super().__init__()
        # å»ºæ§‹å­
        self.input_fc = nn.Linear(input_dim, 250)     # (input_dim=784)ï¼Œ250 å¯è‡ªè¡Œæ›´æ›æˆä½ å¸Œæœ›ä»–çš„ç¶­åº¦
        self.hidden_fc = nn.Linear(250, 100)          # (250, 100)ï¼Œé€™è£¡çš„ 250 æ˜¯æ¥ä¸Šä¸€å±¤çš„è¼¸å‡ºï¼Œæ‰€ä»¥å¦‚æœä¸Šä¸€å±¤çš„è¼¸å‡ºç¶­åº¦æ”¹è®Šï¼Œé€™ä¸€å±¤çš„è¼¸å…¥å°±è¦è·Ÿè‘—æ”¹è®Š!
        self.output_fc = nn.Linear(100, output_dim)   # (100, output_dim=10)ï¼ŒåŒä¸Š

    def forward(self, x):
        # å±¤èˆ‡å±¤ä¹‹é–“çš„æµå‹•
        # x = [batch size, height, width] -> [åœ–ç‰‡æ•¸é‡, height pixel, width pixel]

        batch_size = x.shape[0]
