"""### Model 2 - CNN - LeNet5

CNN = Convolution + Pooling + Fully connection \
CNN ä¸»è¦è™•ç†å…·æœ‰ç¶²æ ¼çµæ§‹çš„æ•¸æ“š e.g. åœ–åƒ \
Convolution: é€éå·ç©å°‡è¼¸å…¥æ•¸æ“šè½‰æ›ç‚ºä¸€ç³»åˆ—ç‰¹å¾µåœ–(feature map) \
Pooling: æ¸›å°‘ç‰¹å¾µåœ–çš„å°ºå¯¸ï¼ŒåŒæ™‚ä¿ç•™é‡è¦ç‰¹å¾µè³‡è¨Šï¼Œå¸¸è¦‹: average pooling. max pooling ... \
Fully connection: è² è²¬ç‰¹å¾µç¶œåˆã€åˆ†é¡å’Œé æ¸¬ç­‰ä»»å‹™

[Cnn-Explainer](https://poloclub.github.io/cnn-explainer/)


å…±7å±¤: å·ç©å±¤ (Convolutions, C1)ã€æ± åŒ–å±¤ (Subsampling, S2)ã€å·ç©å±¤ (C3)ã€æ± åŒ–å±¤ (S4)ã€å…¨é€£æ¥å·ç©å±¤ (C5)ã€å…¨é€£æ¥å±¤ (F6)ã€Gaussian é€£æ¥å±¤ (output)

![æˆªåœ– 2023-11-26 ä¸‹åˆ7.13.59.png](data:image/png;base64,)
"""

# å»ºç«‹ CNN æ¨¡å‹
class CNN(nn.Module):
    def __init__(self, input_dim, output_dim):
        super().__init__()
        # C1 + S2
        self.conv1 = nn.Sequential(         # input shape (1, 32, 32)
            nn.Conv2d(                      # output shape (6, 28, 28)
                in_channels=1,              # input height
                out_channels=6,             # n_filters
                kernel_size=5,              # filter size
                stride=1,                   # filter movement/step
                padding=2,
            ),
            nn.Tanh(),                      # activation
            nn.AvgPool2d(kernel_size=2),    # output shape (6, 14, 14)
        )
        # C3 + S4
        self.conv2 = nn.Sequential(         # input shape (6, 14, 14)
            nn.Conv2d(6, 16, 5, 1),         # output shape (16, 10, 10)
            nn.Tanh(),                      # activation
            nn.AvgPool2d(kernel_size=2),    # output shape (16, 5, 5)
        )
        # C5 + FC6
        self.conv3 = nn.Sequential(         # input shape (16, 5, 5)
            nn.Conv2d(16, 120, 5, 1),       # output shape (120, 1, 1)
            nn.Flatten(),
            nn.Linear(120, 84),
        )
        self.out = nn.Linear(84, output_dim)   # fully connected layer, output 10 classes

    def forward(self, x):
        h_conv1 = self.conv1(x)
        h_conv2 = self.conv2(h_conv1)
        h_conv3 = self.conv3(h_conv2)
        h_conv3= h_conv3.view(h_conv3.size(0), -1)           # flatten the output of conv2 to (batch_size, 32 * 7 * 7)
        y_pred = self.out(h_conv3)
        return y_pred   # return x for visualization

# å»ºç«‹ CNN æ¨¡å‹
model_CNN = CNN(INPUT_DIM, OUTPUT_DIM)
