import torch
from transformers import BertTokenizer, BertModel

import matplotlib.pyplot as plt

USE_PRETRAINED = 'bert-base-uncased'
# æœ‰é€™äº› pretrained å¯ä»¥ç”¨ç”¨çœ‹
#'bert-base-chinese'        #'hfl/chinese-roberta-wwm-ext-large'    #'bert-base-uncased'

# ç ”ç©¶å–å‡º word embeddings
# functions
def bert_text_preparation(text, tokenizer):
    """Preparing the input for BERT

    Takes a string argument and performs pre-processing like adding special tokens,
    tokenization, tokens to ids, and tokens to segment ids. All tokens are mapped to segment id = 1.

    Args:
        text (str): Text to be converted
        tokenizer (obj): Tokenizer object to convert text into BERT-readable tokens and ids

    Returns:
        list: List of BERT-readable tokens
        obj: Torch tensor with token ids
        obj: Torch tensor segment ids


    """
    marked_text = "[CLS] " + text + " [SEP]" # "[CLS]" -> å¥é¦– ; "[SEP]" -> å¥å°¾
    tokenized_text = tokenizer.tokenize(marked_text) # example of tokenization(åˆ†è©): "playing" â†’ ["play", "##ing"]
    indexed_tokens = tokenizer.convert_tokens_to_ids(tokenized_text)
    segments_ids = [1]*len(indexed_tokens) # åªè™•ç†å–®å¥æ™‚ï¼Œsegment id å…¨è¨­ç‚º 1

    # Convert inputs to PyTorch tensors
    tokens_tensor = torch.tensor([indexed_tokens])
    segments_tensors = torch.tensor([segments_ids])

    return tokenized_text, tokens_tensor, segments_tensors

def get_bert_embeddings(tokens_tensor, segments_tensors, model):
    """Get embeddings from an embedding model

    Args:
        tokens_tensor (obj): Torch tensor size [n_tokens] with token ids for each token in text
        segments_tensors (obj): Torch tensor size [n_tokens] with segment ids for each token in text
        model (obj): Embedding model to generate embeddings from token and segment ids

    Returns:
        list: List of list of floats of size
            [n_tokens, n_embedding_dimensions]
            containing embeddings for each token

    """

    model.eval() #ç”¨æ–¼inferece, ä¸æœƒæ›´æ–°æ¬Šé‡

    # Run the text through BERT, and collect all of the hidden states produced
    # from all 12 layers.
    with torch.no_grad():
        outputs = model(tokens_tensor, segments_tensors)

        # Evaluating the model will return a different number of objects based on
        # how it's  configured in the `from_pretrained` call earlier. In this case,
        # becase we set `output_hidden_states = True`, the third item will be the
        # hidden states from all layers. See the documentation for more details:
        # https://huggingface.co/transformers/model_doc/bert.html#bertmodel
        hidden_states = outputs[2] # å¾æ¨¡å‹è¼¸å‡ºä¸­æå–éš±è—ç‹€æ…‹

        # Concatenate the tensors for all layers. We use `stack` here to
        # create a new dimension in the tensor.
        token_embeddings = torch.stack(hidden_states, dim=0) # ä½¿ç”¨torch.stackå°‡æ‰€æœ‰å±¤çš„éš±è—ç‹€æ…‹æ²¿è‘—ç¬¬0ç¶­å †ç–Šï¼Œå‰µå»ºä¸€å€‹æ–°çš„ç¶­åº¦

        #print(token_embeddings.size())
        # Remove dimension 1, the "batches".
        token_embeddings = torch.squeeze(token_embeddings, dim=1) #ä½¿ç”¨torch.squeezeç§»é™¤batchesç¶­åº¦, dim=1å› ç‚ºè¼¸å…¥æ•¸é‡æ˜¯1

        #print(token_embeddings.size())

        # Swap dimensions 0 and 1.
        token_embeddings = token_embeddings.permute(1,0,2) #ä½¿ç”¨ permute äº¤æ›ç¬¬0ç¶­å’Œç¬¬1ç¶­ -> äº¤æ›å¾Œï¼Œç¬¬ä¸€ç¶­è¡¨ç¤ºåºåˆ—ä¸­çš„æ¯å€‹tokenï¼Œç¬¬äºŒç¶­è¡¨ç¤ºBERTçš„æ¯ä¸€å±¤

        print(token_embeddings.size())
        return token_embeddings

# Load pre-trained model (weights)
# Whether the model returns all hidden-states.

