import torch
import torch.nn as nn
import torch.nn.functional as F

# ç¯„ä¾‹ model æ¶æ§‹
class Model(nn.Module):
    def __init__(self, input_dim, output_dim):
        super(Model, self).__init__()
        # try it!
        self.input_fc = nn.Linear(input_dim, 16)
        #self.dropout1 = nn.Dropout(0.3)  # åŠ  Dropout æŠ‘åˆ¶ overfitting

        self.hidden_fc = nn.Linear(16, 8)
        #self.dropout2 = nn.Dropout(0.3)

        self.output_fc = nn.Linear(8, output_dim)


    def forward(self, x):
        # try it!
        x = F.relu(self.input_fc(x))          # ç¬¬ä¸€å±¤ relu
        #x = self.dropout1(x)                # Dropout
        x = F.relu(self.hidden_fc(x))       # ç¬¬äºŒå±¤ relu
        #x = self.dropout2(x)                # Dropout
        output = self.output_fc(x)            # è¼¸å‡º output
        return output

device = torch.device('cuda' if torch.cuda.is_available() else 'cpu')
from torchsummary import summary

# input_dim = 28 * 28 = 784
nn_model = Model(input_dim=784, output_dim=1).to(device)

