criterion = nn.BCEWithLogitsLoss()# äºŒå…ƒåˆ†é¡è¦ç”¨ä»€éº¼ (binary loss function, pytorch)? è¨ˆç®—loss , Try it!
optimizer = torch.optim.Adam(nn_model.parameters(), lr=LEARNING_RATE)

train_loss_history, train_acc_history = [], []
for epoch in range(EPOCHES):
    epoch_loss, epoch_acc = 0, 0
    nn_model.train()

    for inputs, labels in trainloader:
        pred_y = nn_model(inputs)
        loss = criterion(pred_y, labels)

        prob = torch.sigmoid(pred_y)
        pred = prob.round()
        acc = pred.eq(labels.view_as(pred)).sum().item() / len(labels)
        #acc = pred_y.round().eq(labels.view_as(pred_y.round())).sum() / len(labels)
        optimizer.zero_grad()
        loss.backward()
        optimizer.step()

        epoch_loss += loss.item()
        epoch_acc += acc

    mean_train_loss = epoch_loss / len(trainloader)
    mean_train_acc = epoch_acc / len(trainloader)
    train_loss_history.append(mean_train_loss)
    train_acc_history.append(mean_train_acc)

