# testing
def predict(test_loader, model):
    model.eval()
    pred_y = []
    with torch.no_grad():
        for inputs, labels in test_loader:
            logits = model(inputs)
            probs = torch.sigmoid(logits)  # å°‡ logits è½‰ç‚ºæ©Ÿç‡
            pred = probs.round()           # å°‡æ©Ÿç‡å››æ¨äº”å…¥ç‚º 0 æˆ– 1
            pred_y.append(pred.detach())
    pred_y = torch.cat(pred_y, dim=0).numpy()
    return pred_y

pred_y = predict(testloader, nn_model)
misclassified = len(np.where(test_Y.flatten() != pred_y.round().flatten())[0]) / len(test_Y) * 100
test_acc = len(np.where(test_Y.flatten() == pred_y.round().flatten())[0]) / len(test_Y) * 100

print(f'Percentage of misclassified: {misclassified:.4f}%')
print(f'Percentage of acc: {test_acc:.4f}%')